import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import NateLauncher from './downloads/storage/NateLauncher';

function App() {
  return (
    <Router>
      <Switch>
        <Route path="/downloads/NateLauncher" component={NateLauncher} />
        {/* Add other routes here */}
      </Switch>
    </Router>
  );
}

export default App;
